description:
The DB Class 411 ICE-T for Train Simulator is available in Deutsche Bahn red and white livery and features scripted tilting technology, improved passenger view and lighting, AFB speed control, SIFA driver vigilance system, and PZB and LZB signalling systems. 

The locomotive is also Quick Drive compatible, giving you the freedom to drive the DB BR Class 411 ICE-T on any Quick Drive enabled route for Train Simulator. Also included are scenarios specifically for the Hamburg-Hanover route (available separately and required to play these scenarios).


Please support the developers and buy some of their content if you can afford it.


Please use the email address or the facebook fanpage for requests, questions and also if you want to share an addon with the community which we will post on your behalf.

If you would like to contribute, please read the Readme.pdf.


